package Test389

import (
	"testing"
)

func Test(t *testing.T) {
	//s:="ae"
	//ts:="aea"

	s := ""
	ts := ""

	data := findTheDifference(s, ts)
	t.Log(string(data))
}

func findTheDifference(s string, t string) byte {
	var a, b int
	for _, ss := range s {
		a += int(ss)
	}
	for _, ss := range t {
		b += int(ss)
	}
	return byte(b - a)
}
